DROP TABLE IF EXISTS `responsive_preview`;

CREATE TABLE `responsive_preview` (
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT 'Device machine name.',
  `label` varchar(128) NOT NULL DEFAULT '' COMMENT 'Human readable device label.',
  `width` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The width of the device screen in pixels.',
  `height` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The height of the device screen in pixels.',
  `dppx` float unsigned NOT NULL DEFAULT '0' COMMENT 'The number of dots per pixel unit.',
  `orientation` varchar(32) NOT NULL DEFAULT '' COMMENT 'The default orientation of the device.',
  `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'Weight, used in lists of devices.',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Whether a device is available to end users for previewing. (0 = no, 1 = yes)',
  `langcode` varchar(12) NOT NULL DEFAULT '' COMMENT 'Language code, e.g. ’de’ or ’en-US’.',
  PRIMARY KEY (`name`),
  KEY `list` (`weight`,`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

